    def backtrack(start, slate):
        nonlocal result
        if len(slate) == k:
            subseqs.append(slate[:])
            return
        if len(slate) > k:
            return
        for i in range(start, n):
            slate.append(s[i])
            backtrack(i + 1, slate)
            slate.pop()

    backtrack(0, [])

