    n, s = stdin.split()
    n = int(n)

    if not (1 <= n <= 100) or not (1 <= len(s) <= 200):
        return "Invalid input"

    def is_regular(brackets: str) -> bool:
        stack = []
        for char in brackets:
            if char == "(":
                stack.append("(")
            elif char == ")":
                if not stack:
                    return False
                stack.pop()
        return not stack

    def count_brackets(brackets: str, index: int) -> int:
        count = 0
        while index < len(brackets) and brackets[index] == "(":
            count += 1
            index += 1
        return count

    def count_substrings(brackets: str, s: str) -> int:
        count = 0
        index = 0
        while index <= len(brackets) - len(s):
            if brackets[index:index + len(s)] == s:
                count += 1
            index += 1
        return count

    def regular_brackets_count(n: int, s: str) -> int:
        total = 0
        for i in range(len(s)):
            for j in range(i + 1, len(s) + 1):
                substring = s[i:j]
                if is_regular(substring):
                    remaining_length = n - len(substring)
                    remaining_count = regular_brackets_count(remaining_length, s)
                    total += count_substrings(substring, s) * remaining_count
        return total % (10**9 + 7)

    return str(regular_brackets_count(2*n, s))

