    def dfs(current_rating: int, projects_count: int, current_index: int, memo: dict) -> int:
        if current_index >= len(projects):
            return projects_count

        if (current_rating, current_index) in memo:
            return memo[(current_rating, current_index)]

        a, b = projects[current_index]
        if current_rating >= a:
            memo[(current_rating, current_index)] = max(
                dfs(current_rating + b, projects_count + 1, current_index + 1, memo),
                dfs(current_rating, projects_count, current_index + 1, memo),
            )
        else:
            memo[(current_rating, current_index)] = dfs(current_rating, projects_count, current_index + 1, memo)

        return memo[(current_rating, current_index)]

    return str(dfs(r, 0, 0, {}))

