    def is_prime(num: int) -> bool:
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def gcd(a: int, b: int) -> int:
        while b:
            a, b = b, a % b
        return a

    def sqrt_int(n: int) -> int:
        if n == 0 or n == 1:
            return n
        a, b = n, (n + 1) // 2
        while a <= b:
            c = (a + b) // 2
            c_squared = c * c
            if c_squared == n:
                return c
            elif c_squared < n:
                a = c + 1
            else:
                b = c - 1
        return b

    def count_moves(n: int) -> int:
        if n == 1:
            return 0
        prime_factors = set()
        for i in range(2, int(sqrt_int(n)) + 1):
            while n % i == 0:
                prime_factors.add(i)
                n //= i
        if n > 1:
            prime_factors.add(n)

        count = 0
        for p in prime_factors:
            count += (sqrt_int(p) - 1) // (p - 1)

        return count

    return str(count_moves(N))

