    n, m, k = map(int, stdin.split()[:3])
    grid = [list(map(int, line.split())) for line in stdin.split('\n')[1:n+1]]

    # Calculate xor of the numbers in the path
    def xor_sum(path):
        xor = 0
        for i, j in path:
            xor ^= grid[i-1][j-1]
        return xor

    # Recursive function to find paths
    def count_paths(i, j, k, path):
        if i == n and j == m:
            return 1 if xor_sum(path) == k else 0
        count = 0
        if i < n:
            count += count_paths(i+1, j, k, path + [(i+1, j)])
        if j < m:
            count += count_paths(i, j+1, k, path + [(i, j+1)])
        return count

    # Find and return the number of paths
    return str(count_paths(1, 1, k, [(1, 1)]))

