def solution(stdin: str) -> str:
    # Initialize variables
    memory = [0] * 30000
    pointer = 0
    output = ""

    # Helper functions
    def move_pointer(n: int) -> None:
        nonlocal pointer
        pointer += n

    def increment_value(n: int) -> None:
        memory[pointer] += n

    def decrement_value(n: int) -> None:
        memory[pointer] -= n

    def output_value() -> None:
        nonlocal output
        output += chr(memory[pointer])

    # Process the input expression
    for char in stdin:
        if char == "+":
            increment_value(1)
        elif char == "-":
            decrement_value(1)
        elif char == ">":
            move_pointer(1)
        elif char == "<":
            move_pointer(-1)
        elif char == ".":
            output_value()

    # Generate the Brainfuck program
    brainfuck_program = ">" * pointer
    if memory[pointer] > 0:
        brainfuck_program += "+" * memory[pointer]
    else:
        brainfuck_program += "-" * abs(memory[pointer])

    return brainfuck_program + "."

