def solution(stdin: str) -> str:
    n, sequence = map(int, stdin.split())
    sequence = list(map(int, sequence))

    def is_valid(x: int) -> bool:
        if x % 3 != 0:
            return False
        while x >= 2:
            if x == 2:
                return True
            x //= 2
        return False

    def is_valid_sequence(sequence: List[int]) -> bool:
        for i in range(1, len(sequence)):
            if not is_valid(sequence[i]):
                return False
            if sequence[i] == 2 * sequence[i - 1]:
                continue
            elif sequence[i] == sequence[i - 1] // 3:
                continue
            else:
                return False
        return True

    def find_path(sequence: List[int]) -> List[int]:
        visited = set()
        path = [sequence[0]]
        visited.add(sequence[0])
        for i in range(1, len(sequence)):
            if sequence[i] == 2 * path[-1]:
                path.append(sequence[i])
                visited.add(sequence[i])
            elif sequence[i] == path[-1] // 3:
                path.append(sequence[i])
                visited.add(sequence[i])
            else:
                for j in range(len(sequence)):
                    if sequence[j] not in visited:
                        path.append(sequence[j])
                        visited.add(sequence[j])
                        break

        return path

    while not is_valid_sequence(sequence):
        sequence = find_path(sequence)

    return " ".join(map(str, sequence))


