    if N % 1 == 0:
        operations += N
    elif N % 9 == 0:
        operations += N // 9
    else:
        # Use geometric series formula to find the sum of first n terms
        def sum_of_series(n: int, a: int) -> int:
            return (n * (2 * a - 1) * (a - 1)) // 2

        # Find the highest power of 6 that is less than or equal to N
        power_of_6 = 1
        while 6**power_of_6 <= N:
