            if i == 0:
                return True
            return (len(contest_sequence[i]) * 2 == len(contest_sequence[i - 1]) and
                    contest_sequence[i] not in contest_sequence[0:i])

        def backtracking(i: int, contest_sequence: List[int]) -> bool:
            if i == n:
                return is_valid_sequence(contest_sequence, i - 1)

            for topic in topics:
                if topic not in contest_sequence[i]:
                    contest_sequence[i].add(topic)
                    if backtracking(i + 1, contest_sequence):
                        return True
                    contest_sequence[i].remove(topic)

            return False

        for _ in range(n):
            contest_sequence.append(set())

        return backtracking(0, contest_sequence)

