    def abs_diff(i: int, j: int) -> int:
        return abs(a[i] - a[j])

    def update(i: int, j: int) -> None:
        if a[i] > a[j]:
            a[i] -= abs_diff(i, j)
        else:
            a[i] += abs_diff(i, j)

    def make_equal() -> int:
        k = 0
        for i in range(n - 1):
            for j in range(i + 1, n):
                if abs_diff(i, j) > 0:
                    update(i, j)
                    k += 1
        return k

    k = make_equal()
    output = []

    for i in range(n - 1):
        for j in range(i + 1, n):
            if abs_diff(i, j) > 0:
                output.append(f"{1 if a[i] > a[j] else 2} {i + 1} {j + 1}\n")

    return f"{k}\n{''.join(output)}"


