            if transpose(m1, i) == m2:
                return True
        return False

    def is_inversion(m1: list, m2: list) -> bool:
        for i in range(12):
            if invert(m1, i) == m2:
                return True
        return False

    def is_retrograde(m1: list, m2: list) -> bool:
