    def rotate_piece(piece: List[int], degrees: int) -> List[int]:
        result = piece.copy()
        for _ in range(degrees // 90):
            result = [result[j] + i for i in range(len(result)) for j in range(i, len(result))]
        return result

    def drop_piece(heights: List[int], piece: List[int], position: int) -> List[int]:
        result = heights.copy()
        for i, h in enumerate(heights):
            if i < position or i >= position + len(piece):
                continue
            result[i] = max(result[i], piece[i - position])
        return result

    def count_configurations(heights: List[int], piece: List[int]) -> int:
        result = 0
        for position in range(len(heights) - len(piece) + 1):
            rotated_piece = rotate_piece(piece, 90)
            while rotated_piece[0] <= heights[position]:
                new_heights = drop_piece(heights, rotated_piece, position)
                if all(height == 0 for height in new_heights):
                    return 1
                result += count_configurations(new_heights, rotated_piece)
                rotated_piece = rotate_piece(rotated_piece, 90)
        return result

