    input_data = stdin.split('\n')
    t, N, M = map(int, input_data[0].split())
    grid = input_data[1:N+1]

    # Find the starting position of Eren
    start_pos = None
    for i in range(N):
        for j in range(M):
            if grid[i][j] == 'S':
                start_pos = (i, j)
                break

    # Create a queue for BFS
    from collections import deque
    queue = deque([(start_pos, 0)])
    visited = set()

    # Define the directions of movement for Eren
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]

    # Define a function to check if the movement is valid
    def is_valid(x, y):
        if 0 <= x < N and 0 <= y < M:
            if grid[x][y] == '1':
                return False
            elif grid[x][y] == 'U' and (x, y) != start_pos:
                return False
            elif grid[x][y] == 'D' and (x, y) != start_pos:
                return False
            elif grid[x][y] == 'L' and (x, y) != start_pos:
                return False
            elif grid[x][y] == 'R' and (x, y) != start_pos:
                return False
            else:
                return True
        else:
            return False

    # Define a function to check if Eren has reached the border
    def has_reached_border(x, y):
        if x == 0 or x == N-1 or y == 0 or y == M-1:
            return True
        else:
            return False

    # Start BFS
    while queue:
        (x, y), dist = queue.popleft()

        if (x, y) not in visited:
            visited.add((x, y))

            if has_reached_border(x, y) and dist <= t:
                return dist

            for dx, dy in directions:
                new_x, new_y = x + dx, y + dy
                if is_valid(new_x, new_y):
                    queue.append(((new_x, new_y), dist+1))

    # If the queue is empty, Eren cannot escape within t units
    return "NOT POSSIBLE"

