    def probability(dice):
        a, b = int(dice[0]), int(dice[1])
        c = int(dice[2])
        prob = 0
        for i in range(a, b + 1):
            for j in range(a, b + 1):
                if i != j:
                    if i + j > c:
                        prob += 1
        return prob / ((b - a + 1) * (b - a + 1) - 1)

    gunnar_prob = probability(gunnar_dice)
    emma_prob = probability(emma_dice)

    # output result
    if gunnar_prob > emma_prob:
        return "Gunnar"
    elif gunnar_prob < emma_prob:
        return "Emma"
    else:
